class I2CPrimitive:
    def _scan(self, start=1, end=128) -> List[int]:
        addrs = []
        for address in range(start, end):  # 0 is the general call address.
            slave = I2CSlave(address, self._device)
            if slave.ping():
                addrs.append(address)
        return addrs

class I2CMaster:
    def scan(self):
        addrs = self._scan()
        for address in addrs:
            logger.info(f"Response from slave on {hex(address)} ({sensors.get(address, 'None')}).")
        return addrs

# busio.py
class I2C:
    def scan(self):
        return self._scan(0x08, 0x77)
